import React from 'react';

const Title = (props) => {
    return (
        <div class="container" style={{textAlign:'center'}}>
    <div className="row title"><strong>{props.name}</strong></div>
    <div className="row title" class="btn"><strong>{props.title}</strong></div>
        </div>
    );
};

export default Title;
